import React, { useState } from 'react';

function Home() {
  const [count, setCount] = useState(0);

  const handleClick = () => setCount(count + 1);

  return (
    <div>
      <h1>Home Page</h1>
      <p>Welcome to the React SPA!</p>
      <button onClick={handleClick}>You clicked {count} times</button>
    </div>
  );
}

export default Home;
